import React from 'react';
import styled from 'styled-components';

const Button = styled.button`
    width: 10rem;
    height: 3rem;

    border-radius: 1.5rem;
    background-color: ${props =>
        props.type === 'button' ? '#00462A'
            : props.type === 'button' ? '#00462A'
                : props.theme.white};
    cursor:pointer;
    margin : 1.5rem;
    display: inline-flex;

    color:${props =>
        props.type === 'button' ? 'white'
            : 'black'};
    display:flex;
    justify-content:center;
    align-items:center;
    font-family:${props => props.type === 'button' ? 'Jalnan' : 'Spoqa-Han-Sans'};
    font-weight: 400;
    font-size:1.5rem;
    text-align:center;
    border:${props => props.type === 'button' ? '3px solid #00462A' : '3px solid lightgray'};

`

function PageMoveButtonComponent({ type, text, onclick }) {
    return (
        <Button type={type} onClick={onclick}>{text}</Button>
    )
}

export default PageMoveButtonComponent;
